def largest_subset(arr):
    # Create a dictionary to store the count of each number's occurrence
    occurrence = {}
    for num in arr:
        occurrence[num] = occurrence.get(num, 0) + 1

    # Find the maximum subset size by adding the counts of each number whose multiples are also in the array
    max_size = 0
    for num in occurrence:
        divisible_count = sum(occurrence.get(mult, 0) for mult in range(num * 2, max(arr) + 1, num))
        max_size = max(max_size, occurrence[num] + divisible_count)

