def longestPalindrome(s):
    from collections import Counter
    letter_counts = Counter(s)
    length = 0
    odd = False
    for count in letter_counts.values():
        if count % 2 == 0:
            length += count
        else:
            length += count - 1
            odd = True
    if odd:
        length += 1
    return length
